interface HccCode {
  v24: number[];
  v28: number[];
  display: string;
}

export function getHccForIcd10Code(icd10Code: string): HccCode | undefined {
  const hccRow = hccMap[icd10Code];
  if (!hccRow) {
    return undefined;
  }
  return {
    display: hccRow[0],
    v24: hccRow[1],
    v28: hccRow[2],
  };
}

